The Computer Science Department &lt;ht=
tp://www.uwyo.edu/cosc/&gt; at the University of Wyoming seeks applicants for =
two tenure-track Assistant Professors (positions #0450 and #2507) to start =
in August 2016. We seek individuals that will perform exciting, game-changi=
ng research. To enable new faculty to build their research labs, we offer g=
enerous startup packages, funding for multiple Ph.D. students, access to wo=
rld-class supercomputing resources, and reduced teaching loads for pre-tenu=
re faculty.



For #0450, preference will be given to candidates that rese=
arch AI/Machine Learning, especially, but not limited to, Deep Learning (ak=
a Deep Neural Networks). This hire is intended to amplify existing departme=
nt expertise in this area. For #2507, preference will be given to candidate=
s that research High Performance Computing, Cloud Computing, and/or Big Dat=
a including visualization. Exceptional candidates that research Cybersecuri=
ty are also encouraged to apply.



Candidates must have completed (or exp=
ect to complete by August 2016) a Ph.D. in Computer Science or a related ar=
ea.  Expectations for new faculty include: establishing a vibrant, external=
ly funded research program, teaching at the undergraduate and graduate leve=
ls, advising students, and service to the department and/or college. 



T=
he Computer Science Department is part of the College of Engineering and Ap=
plied Science, and offers B.S., M.S., and Ph.D. degrees in Computer Science=
. Undergraduate programs are ABET accredited and include a concentration in=
 Big Data. The University of Wyoming is closely affiliated with the NCAR-Wy=
oming Supercomputing  Center (NWSC) located 40 miles east of the University=
. NWSC is a petascale supercomputing center designed to maximize data-inten=
sive science. Also, the university Advanced Research Computing Center house=
s and supports the Mount Moran computing cluster, which allows UW faculty t=
o perform supercomputing experiments for free on unused computer cycles, as=
 well as to purchase new supercomputing hardware and have it professionally=
 housed and maintained by the Advanced Research Computing Center staff.  

=


The University of Wyoming is located in Laramie, WY, a lovely, small col=
lege town (population 30,000). Laramie is situated in a scenic location at =
the base of the Rockies. The Medicine Bow National Forest is nearby and pro=
vides quick access to hiking, biking, skiing, rock climbing, fishing, hunti=
ng, and camping. Nearby towns in Colorado (Ft. Collins and Denver) offer ad=
ditional amenities, including an international airport with daily flights t=
o and from the airport in Laramie.



The University of Wyoming is an Equa=
l Employment Opportunity/Affirmative Action employer. All qualified applica=
nts will receive consideration for employment without regard to race, color=
, religion, sex, national origin, disability or protected veteran status or=
 any other characteristic protected by law and University policy. Please se=
e www.uwyo.edu/diversity/fairness &lt;http://www.uwyo.edu/diversity/fairness&gt;.=
 We strongly encourage applications from women and other groups underrepres=
ented in computer science.



The University conducts background investiga=
tions for all final candidates being considered for employment. Offers of e=
mployment are contingent upon the completion of the background check.



T=
o ensure full consideration applications should be completed by January 10,=
 2016 though applications will be accepted until the position is filled.  A=
